export class CityService {
  url;
  constructor() {
    this.url = "https://localhost:5001/api/city";
  }

  async getAllCities() {
    const request = await fetch(this.url);
    return await request.json();
  }

  async getCityByName(name) {
    const request = await fetch(this.url + "/" + name);
    return await request.json();
  }

  async getClientCity() {
    const request = await fetch(this.url + "/client");
    return await request.json();
  }
}

let cityService = new CityService();
let ac = cityService.getAllCities().then((el) => {
  console.log(el);
});
console.log(ac);
